import * as React from 'react';
import { styled } from '@mui/material/styles';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import ChillImage from "../images/chilldood.svg";

const Item = styled(Paper)(({ theme }) => ({
  textAlign: 'center',
}));

function Chill() {
  // Import result is the URL of your image
  return <img src={ChillImage} alt="Dood Chills" />;
}

export default function BasicGrid() {
  return (
      <Grid container spacing={2} style={{ display: "flex", height: "100vh", backgroundColor: "#384885", padding: "40px"}}>
        <Grid item xs={ 4 } md= {4}>
          <Item elevation={0} style={{backgroundColor: "#384885", color: "#ffffff",}}>
          <img src={ChillImage} alt="Logo"
            style={{
              maxWidth: "100%",
              minWidth: "300px",
              height: "auto",
              marginLeft: "20px",
          }}
          />

          </Item>
        </Grid>
        <Grid item xs={ 4 } md= {4}>
          <Item elevation={0} style={{backgroundColor: "#384885", color: "#ffffff",}}>
          <img src={ChillImage} alt="Logo"
            style={{
              maxWidth: "100%",
              minWidth: "300px",
              height: "auto",
              marginLeft: "20px",
          }}
          />

          </Item>
        </Grid>
      </Grid>
  );
}
